import "./movies.css";
import Skeleton, { SkeletonTheme } from "react-loading-skeleton";
const Movies = () => {
  return (
    <>
      <div className="grid">
        <div className="card">
          <div className="img">
            {<Skeleton height={300} />}
            <img src="./images/space.jpg" alt=""></img>
          </div>
          <h2 className="title">Hello</h2>
        </div>
        <div className="card">
          <img src="./images/space.jpg" alt=""></img>
          <h2 className="title">Hello</h2>
        </div>
        <div className="card">
          <img src="./images/space.jpg" alt=""></img>
          <h2 className="title">Hello</h2>
        </div>
      </div>
    </>
  );
};

export default Movies;
